import { memo } from 'react';

const CheckedboxIcon = (props) => (
  <svg preserveAspectRatio='none' viewBox='0 0 24 24' fill='none' xmlns='http://www.w3.org/2000/svg' {...props}>
    <rect width={24} height={24} rx={4} fill='#8D0B0B' />
    <path d='M5.50003 12.5L10.5 17L19 7' stroke='white' strokeWidth={3} strokeLinecap='round' />
  </svg>
);

const Memo = memo(CheckedboxIcon);
export { Memo as CheckedboxIcon };
